import axios from 'axios';

const Book = () => {
    const [book, setBook] = useState([]);
    useEffect(() => {
        const fetchBookData = async () => {
            try {
                const res = await axios.get('http://localhost:8821/books')
                console.log(res)
                setBook(res.data);
            }
            catch (err) {
                console.log(err)
            }
        }
        fetchBookData();
    }, [])
    return (
        <div>

            <h1>Hatsune Miku Manga Shopdsds</h1>
            <div className='book-list'>
                {
                    book.forEach((data, index) => (
                        <div className='' key={index}>
                           <p>{data.title}</p>
                           <p>{data.description}</p>

                        </div>
                    ))
                }
            </div>
        </div>
    )
}

export default Book
